    - Style your chat app according to your preferences.

3. Implement the JavaScript logic:
    - Load the BlenderBot-400m-distill model using the `@huggingface/blenderbot-400m-distill` library.
    - Create a function to handle message submission.
    - Use the `transformers.js` library to preprocess and encode the user input and BlenderBot-400m-distill's response.
    - Render the chat messages using JavaScript.

