// Assertions
BoolExpr xGreaterThanY = ctx.mkGt(x, y);
BoolExpr readConstraint = ctx.mkEq(ctx.mkSelect(array, x), y);

s.add(xGreaterThanY);
s.add(readConstraint);

if (s.check() == Satisfiable) {
  Model m = s.getModel();

  // Print model
  System.out.println("x = " + m.evaluate(x, false));
  System.out.println("y = " + m.evaluate(y, false));

  // Evaluate expressions on model
  System.out.println("array[" + x + "] = " + m.evaluate(array, m.evaluate(x, false)));

} else {
  System.out.println("Unsatisfiable");
}
```

This shows:

